import logo from './logo.svg';
import React, { useState } from 'react';

import Button from '@mui/material/Button';

import './App.css';

const [fileChosen, setFileChosen] = useState(false);

function fileUpload(e){
    setFileChosen(true);
}

function App() {
  return (
    <div className="App">
      <header className="App-header">
         <Button
              variant="contained"
              component="label"
            >
              {fileChosen ? "File Chosen" : "Upload File"}
              <input
                type="file"
                id="file"
                onChange={fileUpload}
                hidden
              />
            </Button>
      </header>
    </div>
  );
}

export default App;
